Com o app Ontracker, você pode monitorar todos os seus dispositivos rastreados em tempo real!
As atualizações de localização do dispositivo em mapa são automáticas, conforme as transmissões são geradas pelo equipamento.
Ainda é possível:
•	Criar cerca eletrônica (âncora) e receber uma notificação, caso o dispositivo tenha saído da cerca;
•	Visualizar histórico de posições;
•	Exportar localização do dispositivo para outros mapas, como: Wase, Google maps e Google Street View;
•	Visualizar em mapa, a localização do smartphone, em relação ao dispositivo rastreado, em tempo real;
•	*Envio de comandos;
•	*Monitorar o estado de sensores, como: velocidade, distância percorrida, horímetro, tensão da bateria, entre outros;
Observações:
Esse aplicativo é exclusivo para clientes que utilizam a solução de rastreamento e telemetria da Ontracker.
*Visualização de sensores e envio de comandos, podem variar, conforme o modelo do equipamento utilizado.

